css:
@-moz-document domain("torrentleech.org") {

#supportTorrentLeech {
	display: none !important;
	visibility: hidden !important;
}

/* Sets Up Logo */
#middle {
/*background: url("http://torrentleech.org/images/tltop.png") no-repeat scroll 0 -80px transparent;*/
margin: 0 auto !important;
margin-bottom: 3px !important;
margin-top: 3px !important;
height: 85px !important;
width: 953px !important;
background: url(data:image/png;base64,) no-repeat scroll 296px 5px #052126;
border: 1px solid #093740;
}

/* Hides Original Logo, and message centre Image */
#middle > img, #messageCenterImage, #index_sidebar {
display:none;
}

#dropdown > li > a[href*="/user/donate"], #nav_home  {
display:none !important;
}

/* Changes the #memberBar Height */
#memberBar, #TLOld {
height: 17px !important;
background-position: 0px -12px !important; 
}

/*Changes Padding on members that need it */
#memberBar .left, #memberBar .right, #TLOld > div {
margin-top: 1px !important;
}

#TLOld {
margin-top: 1px !important;
}

#navbar, #memberBar, #latest_news, #middle, #TLOld {
-moz-border-radius: 5px 5px 5px 5px;
border-radius: 5px 5px 5px 5px;
}

/* Navbar Changes */
#navbar {
height: 20px !important;
padding-left: 0px !important;
width: 955px !important;
}

#dropdown > li > a {
padding: 0 !important;
padding-top: 1px !important;
padding-left: 10px !important;
padding-right: 10px !important;
height: 20px !important;
}

#dropdown img {
height: 20px !important;
width: 1px !important;
}

#dropdown {
margin: 0pt auto !important;
width: 771px !important;
}


/* Homepage stuff */
#latest_news {
text-align:justify;
}

#newsdata {
width:auto !important;
padding: 10px !important;
}

.newsitem {
text-align:justify;
}

#avatar > img {
width: 140px !important;
height: 140px !important;
left: 0px !important;
}

#latest_news {
width: 953px !important;
padding: 0 !important;
margin: 0 auto !important;
margin-top: 5px !important;
background-color:#052126;
border: 1px solid #093740;
}

.newsitem > h4 {
margin-top: 0px !important;
}

/* Profile */
#profileTabs, #left {
background-image: none !important;
}

#left {
width: 152px !important;
margin-left: 3px !important;
}

#profile {
width: 960px !important;
margin: 0px auto !important;
padding: 0px !important;
padding-top: 5px !important;
}

#profileTabs {
padding: 0 !important;
width: 789px !important;
}

#profileTabs > ul {
background-image: none !important;
background-color: transparent !important;
}

#profileTabs > ul > li {
bottom:0px !important;
padding-bottom: 0px !important;
margin-bottom: -1px !important;
height: 28px;
}

#profileTab, #editprofile, #snatchlist, #bookmarks  {
border-top: 1px solid #061A1D !important;
margin: 0px !important;
}

#editprofile, #bookmarks {
padding-top: 0px !important;
}

/* Snatchlist */
.ui-widget-header {
background-image: none !important;
}

/* HomePage */
#creditsImage {
margin-top: 0 !important;
}

#creditsImage > img, #marketPlaceImage > img {
display: none !important;
}

}
